import React from "react";
import "../css/main.css";
import Button from 'react-bootstrap/Button';
import act from "../jsfile/main";
class main extends React.Component {
    render() {
      return (
        <>
        <h1>Welcome to main page</h1>
        <Button className="add" onClick={act}>Add new Article</Button>
        <div id="form" className="form" name="form">
            <input type="text" name="article" placeholder="Enter Article Name"/>
            <input type="number" name="rating" placeholder="Rating"/>  
            <button type="submit" className="back" onClick={act}>Add</button> 
            

        </div>
        <Button>Sort on the basis of Date</Button>
        <Button>Sort on the basis of Rating</Button>
        
        </>
      );}
      }

export default main;
